import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Quiz from './Components/Quiz';
import { QuizProvider } from './Context/quiz';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <QuizProvider>
    <React.StrictMode>
      <Quiz />
    </React.StrictMode>
  </QuizProvider>

);
